***********************************************************************************************************************************************************

xquery version "1.0-ml";
import module namespace search = "http://marklogic.com/appservices/search" at "/MarkLogic/appservices/search/search.xqy";
for $string in ( 'faname1:"Rick James" NEAR/15 faname1:"Isabella Jones" AND faname1:"Bruce Bell"')

let $xml := <tests>
  <search-string>{$string}</search-string>
{
  for $opt in xdmp:document-get("QA_HOME/testdata/searchAPI-fields/optionsrange.xml")//opt
  let $description := $opt/@frag-scope-type
  let $options := $opt/*
  return
  <test fragment-scope-type="{$description}">
  {
    let $r := search:search($string, $options) return (<search:response total="{$r/@total}">{for $res in $r//*:result return <search:result index="{$res/@index}" uri= "{$res/@uri}">{$res/*:snippet}</search:result>}{$r//*:facet, $r//*:qtext}</search:response>)
  }
  </test>
}
</tests>
return
xdmp:quote($xml,<options xmlns="xdmp:quote"><indent-untyped>yes</indent-untyped></options>)

***********************************************************************************************************************************************************
